%livy2.spark

import org.apache.spark.ml.feature.{StringIndexer, OneHotEncoder, VectorAssembler, IndexToString}
import org.apache.spark.ml.classification.{RandomForestClassificationModel, RandomForestClassifier}
import org.apache.spark.ml.{Pipeline, PipelineModel}
import org.apache.spark.ml.evaluation.{MulticlassClassificationEvaluator}

//Target
val labelIndexer = new StringIndexer().setInputCol("Measure_ID").setOutputCol("Measure_ID_index").fit(dt5)

//Features Categóricas
val cityIndexer = new StringIndexer().setInputCol("City").setOutputCol("City" + "_index").setHandleInvalid("skip").fit(dt5)
val stateIndexer = new StringIndexer().setInputCol("State").setOutputCol("State" + "_index").setHandleInvalid("skip").fit(dt5)
val facilityIndexer = new StringIndexer().setInputCol("Facility_Name").setOutputCol("Facility_Name" + "_index").setHandleInvalid("skip").fit(dt5)
val conditionIndexer = new StringIndexer().setInputCol("Condition").setOutputCol("Condition" + "_index").setHandleInvalid("skip").fit(dt5)

val teste1 = cityIndexer.transform(dt5)
val teste2 = stateIndexer.transform(teste1)
val teste3 = facilityIndexer.transform(teste2)
val teste4 = conditionIndexer.transform(teste3)


//Pôr as features todas num vetor
val featuresAssembler = new VectorAssembler().setInputCols(Array("Score", "Sample", "City_index", "State_index", "Facility_Name_index", "Condition_index")).setOutputCol("features")
val assembled = featuresAssembler.transform(teste4)
//assembled.columns
//assembled.head

//Definir o modelo Random Forest
val rf = new RandomForestClassifier().setLabelCol("Measure_ID_index").setFeaturesCol("features").setNumTrees(15).setMaxDepth(10).setMaxBins(4568)

//Converter para nome
val labelConverter = new IndexToString().setInputCol("prediction").setOutputCol("Previsão_Measure").setLabels(labelIndexer.labels)

//Pipline
val pipeline = new Pipeline().setStages(Array(cityIndexer, stateIndexer, facilityIndexer, conditionIndexer) ++ Array(featuresAssembler, labelIndexer, rf, labelConverter))

//Dividir em train e test
val Array(trainDF, testDF) = dt5.randomSplit(Array(0.70, 0.3))
//trainDF.count
//testDF.count

val model = pipeline.fit(trainDF)

// Usar o "model" para fazer previsões
val testPreds = model.transform(testDF)
//testPreds.columns
testPreds.select("Measure_ID_index", "rawPrediction", "probability", "prediction").take(3)
//labelIndexer.labels

// so true mapped to index 0.0
// false mapped to index 1.0

val evaluator = new MulticlassClassificationEvaluator().setLabelCol("Measure_ID_index").setPredictionCol("prediction").setMetricName("accuracy")
evaluator.evaluate(testPreds)

val trainPreds = model.transform(trainDF)
//trainPreds.head
evaluator.evaluate(trainPreds)
